import React, { Component } from "react";
export default class Index extends Component {
  render() {
    const { fruits } = this.props;
    console.log(fruits);
    return (
      <>
        <div>
          <h1>Fruits Index Page</h1>
          <ul>
            {fruits.map((fruit, i) => {
              return (
                <li key={i}>
                  The <a href={`/fruits/${i}`}>{fruit.name}</a> is {fruit.color}{" "}
                  <br></br>
                  {fruit.readyToEat
                    ? `It is ready to eat`
                    : `It is not ready to eat`}
                  <br />
                </li>
              );
            })}
          </ul>
        </div>
      </>
    );
  }
}
